"""**TRAIN AND TEST SPLIT**

Avant de faire un mod√®le de Machine Learning on doit d'abord faire un train and test split.

Petite explication de ChatGPT (oui encore)
C‚Äôest le fait de diviser ton dataset en deux parties :

Training set : pour entra√Æner ton mod√®le
Testing set : pour tester ton mod√®le (le mettre √† l‚Äô√©preuve)


Quand tu entra√Ænes un mod√®le, tu veux qu‚Äôil apprenne des donn√©es, mais aussi que tu puisses v√©rifier s‚Äôil g√©n√©ralise bien sur des donn√©es qu‚Äôil n‚Äôa jamais vues.

Si tu entra√Ænes et testes sur les m√™mes donn√©es, ton mod√®le peut juste "tricher" (overfitting) et retenir les r√©ponses au lieu de vraiment apprendre.



"""

X = df3.drop('churn',axis='columns')
y = df3['churn']

"""Donc ici on enl√®ve la variable √† pr√©dire : Churn, en enl√®ve la r√©ponde √ßa sera √† l'algorithme de la trouve.
Donc <br> : X = toutes les colonnes sauf "Churn" <br>
Y = 'churn' le r√©sultat cibl√© √† pr√©dire donc juste la colone 'churn
"""

from sklearn.model_selection import train_test_split #Fonction qui permet decouper le dataset en donn√©es d'entrainement de de test
X_train,X_test,y_train,y_test = train_test_split(X,y,test_size=0.2,random_state=5)

X_train.shape

"""La deuxi√®me ligne dit :

Variable	Contenu : <br>
X_train	80% des features pour l‚Äôentra√Ænement  (car on prend 20% pour le test) <br>
X_test	20% des features pour le test <br>
y_train	80% des labels (churn) associ√©s √† X_train <br>
y_test	20% des labels associ√©s √† X_test <br>
"""

X_train[:10] #Selectionnne les 10 premi√®res lignes de mon dataframe = X_train DONC un √©chantillon de mes donn√©es d'entra√Ænement

len(X_train.columns) # Rappel : Len = lenght donc renvoie le nombre d'elements (ex:carract√®res) d'un objet.

"""On a donc 26 colonnes car on a enlev√© la colonne 'churn' rappellez vous."""

len(df3.columns)

"""Alors que sur notre pr√©c√©dente version de data frame 'df3' on avait 27 colonnes car on y avait pas encore supprim√© la colonne 'churn'.

**3. Cr√©ation d'un R√©seau de neuronnes**
"""

import tensorflow as tf
from tensorflow import keras

model = keras.Sequential([
    keras.layers.Dense(20,input_shape=(26,),activation='relu'), #26 : Nombres de neurones / imput_shape=
    keras.layers.Dense(15,activation='relu'),
    keras.layers.Dense(1,activation='sigmoid')
])

model.compile( ### √† creuser
    optimizer='adam',
    loss='binary_crossentropy',
    metrics=['accuracy']
)

#####Run le mod√®le

model.fit(X_train, y_train, epochs=5) #Epochs = correspond √† un passage complet sur l'ensemble des donn√©es d'entra√Ænement. Ici, le mod√®le passera 5 fois sur toutes les donn√©es pour ajuster ses poids et am√©liorer ses pr√©dictions.

"""Ok on va expliquer √ßa parce que c'est bal√®ze : <br> - keras.layers.dense ajoute une couche enti√®rement connect√©e (dense) avec 20 neurones, chaque neurones et conn√©cr√© au neurone pr√©c√©dent. <br>
- input_shape=(26,) : Indique que chaque entr√©e de cette couche est un vecteur de 26 caract√©ristiques. Cette information est n√©cessaire uniquement pour la premi√®re couche afin que le mod√®le sache quelle est la forme des donn√©es d'entr√©e.
- activation='relu' : Sp√©cifie que la fonction d'activation utilis√©e est la ReLU (Rectified Linear Unit). Cette fonction est d√©finie comme relu(x) = max(0, x), ce qui introduit de la non-lin√©arit√© dans le mod√®le et aide √† apprendre des relations complexes. <br> <br>

Ensuite pour la deuxi√®me ligne : <br>

keras.layers.Dense(15, ...) : Ajoute une deuxi√®me couche dense avec 15 neurones. Cette couche re√ßoit les 20 sorties de la couche pr√©c√©dente comme entr√©e.‚Äã <br>

activation='relu' : Comme pr√©c√©demment, utilise la fonction d'activation ReLU pour cette couche.


<br> Le mod√®le est compos√© de deux couches denses.‚Äã

La premi√®re couche a 20 neurones, re√ßoit des entr√©es de 26 caract√©ristiques et utilise la fonction d'activation ReLU.‚Äã

La deuxi√®me couche a 15 neurones et utilise √©galement la fonction d'activation ReLU.
<br>
<br>

Ensuite : <br>

1. Compilation du Mod√®le avec model.compile() <br>
Cette √©tape configure le mod√®le pour l'entra√Ænement en sp√©cifiant :‚Äã <br> <br>

optimizer='adam' : L'optimiseur d√©termine comment le mod√®le ajuste ses poids pour minimiser la perte. L'optimiseur Adam (Adaptive Moment Estimation) est largement utilis√© car il combine les avantages des optimisateurs AdaGrad et RMSProp, offrant une convergence rapide et efficace. ‚Äã <br>

loss='binary_crossentropy' : La fonction de perte mesure l'√©cart entre les pr√©dictions du mod√®le et les valeurs r√©elles. Pour les probl√®mes de classification binaire, comme pr√©dire si un client va r√©silier ou non, la perte de cross-entropie binaire est appropri√©e. Elle √©value la distance entre deux distributions de probabilit√© : les pr√©dictions du mod√®le et les √©tiquettes r√©elles. ‚Äã<br>

metrics=['accuracy'] : Les m√©triques √©valuent les performances du mod√®le. L'exactitude (accuracy) calcule la proportion de pr√©dictions correctes parmi l'ensemble des pr√©dictions, fournissant une indication claire de la performance du mod√®le.
<br>
<br>

-------------------------------------------------------------------------------------------

Je vais essayer d'expliquer avec mes mots qu'est ce qu'un reseau de neuronne artificiel : <br>

Donc un r√©seau de neuronne artificielle est un ensemble de couche et surcouche de neurones, chacuns reli√©s aux pr√©c√©dents, ceux ci s'envoient entre eux les informations qu'ils ont re√ßu en imput afin de vectoriser une probabilit√© de r√©ponse, cet ensemble de vecteur cr√©e un mod√®le qui va orient√© la d√©cision du r√©seau de neuronne en fonction de la position l'ensemble des vecteurs.

**Structure d'un r√©seau de neurones artificiels** : <br>
Un r√©seau de neurones artificiels est compos√© de neurones organis√©s en couches :‚Äã <br>

**Couche d'entr√©e** : Re√ßoit les donn√©es brutes (par exemple, les caract√©ristiques d'un client).‚Äã <br>
**Couches cach√©es** : Traitent les informations re√ßues en appliquant des transformations pour extraire des caract√©ristiques pertinentes.‚Äã <br>
**Couche de sortie** : Fournit le r√©sultat final, comme la probabilit√© qu'un client r√©silie son contrat.

**Apr√®s execution on obtient des r√©sultats d'environ 80% d'accuracy.**

On va tester avec 100 it√©rations :
"""

model.fit(X_train, y_train, epochs=100)

"""Pas mal, l'accuracy augmente avec le nombre d'it√©ration ce qui signifie que le mod√®le est de plus en plus pr√©cis."""

model.fit(X_train, y_train)

"""Donc l√† avec une it√©ration on a 82% d'accuracy, incroyable

**CONVERSION ET TRAITEMENT DES RESULTATS** <br> <br>
On aimerait maintenant convertir ces pourcentage en "OUI ou NON" le client se d√©sabonne, par exemple quand on est au dessus de 50% on peut consid√©rer que le client se d√©sabonne
"""

yp = model.predict(X_test)
yp[:5]

