"""Donc on va cr√©er une fonction qui va convertir donc toute probabilit√© au dessus de 50% donc d√©sabonnement OUI = 1 et sinon d√©sabonnement = NON = 0 <br>

Ou alors c'est simplement une verification de si l'algo a vrai ou faux (je pense que c'est m√™me plut√¥t √ßa), √† v√©rifier.
"""

y_pred = []
for element in yp:
  if element > 0.3:
      y_pred.append(1)
  else:
      y_pred.append(0)


y_pred[:5]

"""OK NON JE VIENS DE CAPTER, 1 = It√©ration avec succ√®s de + de 50% d'accuracy et 0 = - de 50% (oui c'est con mais je viens de r√©aliser)

**CLASSIFICATION REPORT**  <br> Mise en exergue des donn√©es.
"""

from sklearn.metrics import confusion_matrix , classification_report

print(classification_report(y_test,y_pred))

import seaborn as sn #Biblioth√®que de visualisaion de donn√©e

cm = tf.math.confusion_matrix(labels=y_test,predictions=y_pred)

